import React from 'react';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import MenuIcon from '@material-ui/icons/Menu';
import { useStyles } from '../theme/DashboardTheme';
import Devices from '../components/Devices';
import Copyright from '../components/Copyright';
import Button from '@material-ui/core/Button';
import { NavLink as RouterLink, Route } from "react-router-dom";
import { deviceMenuItems } from '../components/DeviceMenuItems';
import Navigation from '../components/Navigation';
import List from '@material-ui/core/List';
import Drawer from '@material-ui/core/Drawer';
import Hidden from '@material-ui/core/Hidden';
import Divider from '@material-ui/core/Divider';
import Paper from '@material-ui/core/Paper';
import clsx from 'clsx';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import Logo from '../images/logo.png';

export default function DeviceManagement() {
  const classes = useStyles();
  const theme = useTheme();
  const [open, setOpen] = React.useState(false);

  const drawer = (
    <div>
      <Toolbar className={classes.toolbar}>        
        <Button edge="end" color="inherit" component={RouterLink} to="/devicemanagement">
          <img src={Logo} alt="Logo" style={{width: "70%", marginRight: "auto", marginLeft: "auto"}} />
        </Button>
      </Toolbar>
      <Divider />
      <List>{deviceMenuItems}</List>
      <Divider />
    </div>
  );

  const container = window !== undefined ? () => window.document.body : undefined;
  const fixedHeightPaper = clsx(classes.paper, classes.fixedHeight);

  return (
    <div className={classes.root}>

      <Navigation />



      <main className={classes.content}>
        <div className={classes.appBarSpacer} />
        <Container maxWidth="lg" className={classes.container}>
          <Route path="/devicemanagement" exact>
            <Grid container spacing={3}>
              <Grid item xs={12} md={4} lg={3}>
                <Paper className={fixedHeightPaper}>
                  {/* <Deposits /> */}
                </Paper>
              </Grid>
            </Grid>
          </Route>
          <Route path="/devicemanagement/device"><Devices /></Route>
        </Container>
      </main>
      <footer className={classes.footer}>
        <Copyright />
      </footer>

    </div>
  );
}
